import React, { useState } from 'react';
import './navbar.css';
import logo from './path_to_logo.pngsrc/assets/logo.jpg';

function Navbar() {
    return (
        <div className="navbar">
            <div className="left-menu">
                {<p><a href='#home'>Обо мне</a></p>}
            </div>
            <div className="center-logo">
                {<p><a href='#wgpt3'>Тренировки</a></p>}
            </div>
            <div className="center-logo">
                <img src="src/assets/logo.jpg" />
            </div>
            <div className="right-menu">
                {<p><a href='#possibility'>Цены</a></p>}
            </div>
            <div className="right-menu">
                {<p><a href='#features'>Обратная связь</a></p>}
            </div>
        </div>
    );
}

export default Navbar;
